J.N. Bhatt, J. 
Prelude (Focal Point) Let us at the very outset, evidently record, remember, and recollect that ;
 "A civilisation is judged by the way it treats its criminals."

They were:-
1. Hire Purchase Finance Institutions;
2. Investment Companies;
3. Chit Funds/Kuris;
4. Nidhis or Mutual Benefit Funds; and 5. Finance Corporations.

(4) This section applies to the following Government scientific experts, namely:
(a) any Chemical Examiner or Assistant Chemical Examiner to Government;
(b) the Chief Inspector of Explosives;
(c) the Director of the Finger Print Bureau;
(d) the Director, Haffkeine Institute, Bombay;
(e) the Director Deputy Director or Assistant Director of a Central Forensic Science Laboratory or a State forensic Science Laboratory;
(f) the Serologist to the Government.

]
     Deoki Nandan  Prasad v.State  of  Bihar  &	 Ors.,[1971]
Supp. S.C.R.  634 and  State of	 Punjab & Anr.v Iqbal Singh,
